import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import { useI18n } from '../../context/I18nContext';
import { useTheme } from '../../context/ThemeContext';

const LandingPage = () => {
  const { t, lang } = useI18n();
  const { isDark } = useTheme();

  return (
    <div style={{
      minHeight: '100vh',
      background: '#0a0a0f',
      color: 'white',
      position: 'relative',
      overflow: 'hidden',
      fontFamily: 'Arial, sans-serif'
    }}>
      {/* Background Pattern */}
      <div style={{
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        backgroundImage: `
          radial-gradient(circle at 20% 80%, rgba(120, 119, 198, 0.2) 0%, transparent 50%),
          radial-gradient(circle at 80% 20%, rgba(255, 119, 198, 0.1) 0%, transparent 50%),
          radial-gradient(circle at 40% 40%, rgba(79, 172, 254, 0.1) 0%, transparent 50%)
        `,
        opacity: 0.6
      }}></div>

      {/* Glowing Circuit Lines */}
      <div style={{
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        background: `
          linear-gradient(45deg, transparent 48%, rgba(120, 119, 198, 0.1) 49%, rgba(120, 119, 198, 0.1) 51%, transparent 52%),
          linear-gradient(-45deg, transparent 48%, rgba(255, 119, 198, 0.1) 49%, rgba(255, 119, 198, 0.1) 51%, transparent 52%)
        `,
        backgroundSize: '60px 60px',
        animation: 'circuit 20s linear infinite'
      }}></div>

      {/* Main Content Container */}
      <div style={{
        maxWidth: '1200px',
        margin: '0 auto',
        padding: '0 20px',
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
        position: 'relative',
        zIndex: 10
      }}>
        
        {/* Logo */}
        <motion.div
          initial={{ opacity: 0, scale: 0.8 }}
          animate={{ opacity: 1, scale: 1 }}
          transition={{ duration: 0.6 }}
          style={{
            position: 'absolute',
            top: '40px',
            left: '40px',
            display: 'flex',
            alignItems: 'center',
            gap: '8px'
          }}
        >
          <div style={{
            width: '40px',
            height: '40px',
            background: 'linear-gradient(135deg, #7877c6 0%, #ff77c6 100%)',
            borderRadius: '8px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            fontSize: '16px',
            fontWeight: 'bold',
            color: 'white'
          }}>
            Z
          </div>
        </motion.div>

        {/* Main Hero Content */}
        <div style={{
          textAlign: 'center',
          maxWidth: '800px',
          margin: '0 auto'
        }}>
          
          {/* Main Headline */}
          <motion.h1
            initial={{ opacity: 0, y: 50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            style={{
              fontSize: '64px',
              fontWeight: '800',
              lineHeight: 1.1,
              marginBottom: '24px',
              letterSpacing: '-0.02em'
            }}
          >
            {lang === 'ar' ? (
              <>
                <span style={{ color: '#4facfe' }}>عزز موقعك</span>{' '}
                <span style={{ color: '#ff77c6' }}>بالذكاء الاصطناعي</span>
              </>
            ) : (
              <>
                <span style={{ color: '#4facfe' }}>BOOST YOUR</span>{' '}
                <span style={{ color: '#ff77c6' }}>WEBSITE WITH AI</span>
              </>
            )}
          </motion.h1>

          {/* Subtitle */}
          <motion.p
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            style={{
              fontSize: '18px',
              color: '#cbd5e1',
              lineHeight: 1.6,
              marginBottom: '40px',
              maxWidth: '600px',
              margin: '0 auto 40px'
            }}
          >
            {lang === 'ar' ? 
              'الذكاء الاصطناعي يمكنه تعزيز التفاعل وتحسين الكفاءة وزيادة التحويلات. ابق متقدماً على المنافسة.' :
              'AI can enhance engagement, improve efficiency, and drive conversions. Stay ahead of the competition.'
            }
          </motion.p>

          {/* CTA Buttons */}
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.6 }}
            style={{
              display: 'flex',
              gap: '20px',
              justifyContent: 'center',
              flexWrap: 'wrap'
            }}
          >
            <Link
              to="/register"
              style={{
                background: 'linear-gradient(135deg, #7877c6 0%, #ff77c6 100%)',
                color: 'white',
                padding: '16px 32px',
                borderRadius: '8px',
                textDecoration: 'none',
                fontWeight: '600',
                fontSize: '16px',
                transition: 'all 0.3s ease',
                border: 'none',
                cursor: 'pointer',
                display: 'inline-block'
              }}
              onMouseOver={(e) => {
                e.target.style.transform = 'translateY(-2px)';
                e.target.style.boxShadow = '0 10px 25px rgba(120, 119, 198, 0.4)';
              }}
              onMouseOut={(e) => {
                e.target.style.transform = 'translateY(0)';
                e.target.style.boxShadow = 'none';
              }}
            >
              {lang === 'ar' ? 'ابدأ الآن' : 'GET STARTED'}
            </Link>

            <Link
              to="/dashboard"
              style={{
                background: 'transparent',
                color: '#ff77c6',
                padding: '14px 30px',
                borderRadius: '8px',
                textDecoration: 'none',
                fontWeight: '600',
                fontSize: '16px',
                border: '2px solid #ff77c6',
                transition: 'all 0.3s ease',
                cursor: 'pointer',
                display: 'inline-block'
              }}
              onMouseOver={(e) => {
                e.target.style.background = '#ff77c6';
                e.target.style.color = 'white';
                e.target.style.transform = 'translateY(-2px)';
              }}
              onMouseOut={(e) => {
                e.target.style.background = 'transparent';
                e.target.style.color = '#ff77c6';
                e.target.style.transform = 'translateY(0)';
              }}
            >
              {lang === 'ar' ? 'جرب مجاناً' : 'START TRIAL'}
            </Link>
          </motion.div>
        </div>
      </div>

      {/* Floating Glow Elements */}
      <motion.div
        animate={{
          y: [0, -20, 0],
          opacity: [0.3, 0.7, 0.3]
        }}
        transition={{
          duration: 4,
          repeat: Infinity,
          ease: "easeInOut"
        }}
        style={{
          position: 'absolute',
          top: '20%',
          left: '15%',
          width: '100px',
          height: '100px',
          background: 'radial-gradient(circle, rgba(79, 172, 254, 0.3) 0%, transparent 70%)',
          borderRadius: '50%',
          filter: 'blur(20px)'
        }}
      />

      <motion.div
        animate={{
          y: [0, 20, 0],
          opacity: [0.2, 0.6, 0.2]
        }}
        transition={{
          duration: 5,
          repeat: Infinity,
          ease: "easeInOut",
          delay: 1
        }}
        style={{
          position: 'absolute',
          bottom: '20%',
          right: '20%',
          width: '150px',
          height: '150px',
          background: 'radial-gradient(circle, rgba(255, 119, 198, 0.3) 0%, transparent 70%)',
          borderRadius: '50%',
          filter: 'blur(25px)'
        }}
      />

      <style jsx>{`
        @keyframes circuit {
          0% { 
            transform: translateX(0) translateY(0); 
          }
          100% { 
            transform: translateX(-60px) translateY(-60px); 
          }
        }
      `}</style>
    </div>
  );
};

export default LandingPage;
